import React from "react";

class CardsPage extends React.Component{


    state = { 
        reickMorty:[],
        characterCards:[]
    }


   getdata = () => {
       fetch('https://rickandmortyapi.com/api/character/')
       .then(response => response.json) 
        .then( data =>{ 
            console.log(data)
        })

   }


    render(){
        return(
            <h1>im an the React</h1>

        )
    }
}



export default CardsPage;
